CREATE PROCEDURE dbo.proc_transform_426
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_426
    SET payload = LEFT(payload, 1000) + N'|V4-426|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_426;
END
